import React, { Component } from 'react'
import Books from './books';
import books from '../../data/Books';
import './semibook.css';



const Seminew = () => {
    state = {

        Books: books

    }

    const books = this.state.Books.map((book) => {
        return (
            <Books book={book} key={book.id} />
        )

    })
    return (
        <div className='booklist'>
            {books}
        </div>

    );

}

export default Seminew;
